DROP TABLE IF EXISTS `stays`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `stays` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `type_stays_id` int unsigned NOT NULL COMMENT 'Ссылка на тип жилья',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название',
  `city` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Город расположения',
  `reviews_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на отзывы',
  `rating` decimal(4,1) DEFAULT NULL,
  `star_rating` int unsigned DEFAULT NULL COMMENT 'Количество звезд',
  `main_settings_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на основные параметры',
  `facilities_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на удобства',
  `price` decimal(11,2) DEFAULT NULL COMMENT 'Цена в сутки',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Жилье';
